import React from "react";
import {Container} from 'react-bootstrap'

let ListAction = ({gategory, allgategory}) => {

    return (
        <div className="menu">
            <Container>
                <div className="text">Menu Food</div>
                <div>
                <div className="actionMenu">
                {
                    allgategory.map(() => {
                        return (
                            <div>
                            <span onClick={() => gategory("العشاء")}>العشاء</span>
                            <span>فطار</span>
                            <span>غدا</span>
                            <span>الكل</span>
                            </div>
                        )
                    })
                }
                </div>

                </div>
            </Container>
        </div>
    )
}

export default ListAction
